import React, { useState } from "react";

import axios from "axios";
import TodoCard from "./TodoCard";

function TodoForm() {
  const [title, setTitle] = useState("");
  const [description, setDescription] = useState("");
  const [status, setStatus] = useState("");
  const [priority, setPriority] = useState("");
  const [todos, setTodos] = useState([]);

  function handleSubmit(e) {
    e.preventDefault();
    axios
      .post("https://td-e464.onrender.com/todos", {
        title,
        description,
        status,
        priority,
      })
      .then((response) => {
        console.log(response.data);
        setTodos([...todos, response.data.data]);
        setTitle("");
        setDescription("");
        setStatus("");
        setPriority("");
      })
      .catch((error) => {
        console.log(error.response);
        alert("There was an error creating your todo. Please try again.");
      });
  }

  function handleDelete(id) {
    axios
      .delete(`https://td-e464.onrender.com/todos/${id}`)
      .then(() => {
        const updatedTodos = todos.filter((todo) => todo._id !== id);
        setTodos(updatedTodos);
      })
      .catch((error) => {
        console.log(error);
        alert("There was an error deleting the todo. Please try again.");
      });
  }

  return (
    <div>
      <h1>Create Todo</h1>
      <form onSubmit={handleSubmit}>
        <label htmlFor="title">Title</label>
        <input
          type="text"
          id="title"
          value={title}
          onChange={(e) => setTitle(e.target.value)}
        />

        <label htmlFor="description">Description</label>
        <textarea
          id="description"
          value={description}
          onChange={(e) => setDescription(e.target.value)}
        ></textarea>

        <label htmlFor="status">Status</label>
        <select
          id="status"
          value={status}
          onChange={(e) => setStatus(e.target.value)}
        >
          <option value="CREATED">Created</option>
          <option value="STARTED">Started</option>
          <option value="COMPLETED">Completed</option>
          <option value="CANCELLED">Cancelled</option>
        </select>

        <label htmlFor="priority">Priority</label>
        <select
          id="priority"
          value={priority}
          onChange={(e) => setPriority(e.target.value)}
        >
          <option value="LOW">Low</option>
          <option value="MEDIUM">Medium</option>
          <option value="HIGH">High</option>
        </select>

        <button type="submit">Create</button>
      </form>
      {todos.map((todo) => (
        <TodoCard key={todo._id} todo={todo} onDelete={handleDelete} />
      ))}
    </div>
  );
}

export default TodoForm;
